@SHossain 
When u say two notarizations in the same block are they both for the same or different blocks? Its very possibly just two nota being confirmed in the same block and is actually very normal behaviour. Labs had major issues making. Cross chain stuff work reliably having to deal with this exact situation. 
 It can be for plenty of reasons. Sure my iguana could be doing it, but I don't see how as it is reaching consensus with main net nodes perfectly as is it on testnet. I have noticed the json has not been updated on git instantly, like the curl doesn't always pull it.  Which can also do it. Will check mine shortly. I suggest people pulling that file manually and checking it is actually updated for them before restarting.

